B.FH=new A.b8(8,{"Prior breast cancer":"The advanced breast cancer risk calculator is not applicable for individuals with any previous diagnosis of breast cancer, LCIS (lobular carcinoma in situ), DCIS (ductal carcinoma in situ), or prior mastectomy. ",Age:"The risk of developing breast cancer increases with age. The great majority of breast cancer cases occur in individuals older than age 60. Most cancers develop slowly over time. For this reason, breast cancer is more common among older individuals. \n\nThe BCSC cumulative 6-year Advanced Breast Cancer Risk Calculator is NOT applicable to individuals younger than 40 or older than age 74.","Race and ethnicity":"The advanced breast cancer risk calculator is calibrated for non-Hispanic White, non-Hispanic Black, Asian, Other/multiple, and Hispanic individuals. If the woman's race/ethnicity is unknown, the tool will use data for non-Hispanic White individuals to estimate the risk.","Family history of breast cancer":"Having one or more first-degree relatives (mother, sisters, daughters) or second-degree relatives (aunts, grandmothers) who have had breast cancer increases an individual's chances of developing breast cancer.","Breast biopsy":"Individuals who have had breast biopsies have an increased risk of breast cancer, especially if their biopsy specimens showed atypical ductal hyperplasia or lobular carcinoma in situ. Individuals who have a history of breast biopsies are at increased risk because of breast changes that can be observed on mammograms and prompt the biopsies. Breast biopsies themselves do not cause cancer.","BI-RADS\xae breast density":"Individuals who have high breast density have an increased risk of breast cancer. Breast density is determined by the relative amounts of fat, epithelial, and connective tissues that appear differently on a mammogram due to differences in X-ray attenuation. Fat appears radiolucent or dark, while epithelial and connective tissues are radiographically dense and appear light or white. A dense breast has less fat than glandular and connective tissue and has more breast cells. Mammograms of breasts with high density are harder to read and interpret than those of less dense breasts and individuals with dense breasts are more likely to develop breast cancer.","Menopausal status":"Menopause is defined as the permanent cessation of ovulation, marked by the end of menstruation for a year. \n\nBased on prior BCSC research, individuals under the age of 40 are assumed to be Premenopausal and individuals aged 60 or older are assumed to be Postmenopausal in the BCSC risk calculators regardless of the menopausal status selected by the user.","Body Mass Index (BMI)":u.I},B.aL1,t.li)
B.aL2=A.a(s(["Atypical ductal hyperplasia","Biopsy","BI-RADS\xae","BRCA1","BRCA2","Breast density","Core biopsy","DCIS (ductal carcinoma in situ)","Excisional biopsy","Fine-needle aspiration biopsy","Invasive breast cancer","LCIS (lobular carcinoma in situ)","Non-proliferative lesions","Proliferative changes with atypia","Proliferative changes without atypia"]),t.s)
B.FI=new A.b8(15,{"Atypical ductal hyperplasia":"A benign (noncancerous) condition in which ductal cells are increased in number and look abnormal. ",Biopsy:"The removal of cells or tissue for examination by a pathologist. The pathologist studies the tissue under a microscope and can perform other tests on the cells or tissue. When an entire lump or suspicious area is removed, the procedure is called an excisional biopsy. When a sample of tissue or fluid is removed with a needle, the procedure is called a needle biopsy, core biopsy, or fine-needle aspiration.","BI-RADS\xae":"A method used by radiologists to interpret and report in a standardized manner the results of mammography, ultrasound, and MRI used in breast cancer screening and diagnosis. Also called Breast Imaging Reporting and Data System.",BRCA1:"A gene on chromosome 17 that normally helps to suppress cell growth. A person who inherits certain mutations (changes) in the BRCA1 gene has a higher risk of breast, ovarian, prostate, and other types of cancer.",BRCA2:"A gene on chromosome 13 that normally helps to suppress cell growth. A person who inherits certain mutations (changes) in the BRCA2 gene has a higher risk of breast, ovarian, prostate, and other types of cancer.","Breast density":"Is determined by the relative amounts of fat, epithelial, and connective tissues that appear differently on a mammogram due to differences in X-ray attenuation. Fat appears radiolucent or dark, while epithelial and connective tissues are radiographically dense and appear light or white. A dense breast has less fat than fibroglandular and connective tissue and has more breast cells. Mammograms with high density are harder to read and interpret than those of less dense breasts and individuals with dense breasts are more likely to develop breast cancer.","Core biopsy":"The removal of a tissue sample with a large diameter needle for examination under a microscope. Also called core needle biopsy.","DCIS (ductal carcinoma in situ)":"A noninvasive condition in which abnormal cells are found in the lining of a breast duct. The abnormal cells have not spread outside the duct to other tissues in the breast. In some cases, DCIS may become invasive cancer and spread to other tissues, although it is not known at this time how to predict which lesions will become invasive.","Excisional biopsy":"A surgical procedure in which an entire lump or suspicious area is removed for diagnosis. The tissue is then examined under a microscope by a pathologist to determine if it is cancerous.","Fine-needle aspiration biopsy":"The removal of tissue or fluid with a thin needle for examination under a microscope. Also called needle biopsy.","Invasive breast cancer":"Cancer that has spread from the ducts or lobules of the breast to surrounding tissue. This includes invasive ductal carcinoma and invasive lobular carcinoma. Invasive breast cancer is the most common type of breast cancer.","LCIS (lobular carcinoma in situ)":"A condition in which abnormal cells are found in the lobules of the breast. This condition seldom becomes invasive cancer; however, having lobular carcinoma in situ in one breast increases the risk of developing breast cancer in either breast.","Non-proliferative lesions":"A benign (noncancerous) condition in which breast cells look normal under a microscope but are not growing at an unusually fast rate. Examples include fibrocystic changes and cysts.","Proliferative changes with atypia":"A benign (noncancerous) condition in which breast cells are growing at an unusually fast rate and look abnormal under a microscope. Women with this condition have a higher risk of developing breast cancer than women with nonproliferative changes.","Proliferative changes without atypia":"A benign (noncancerous) condition in which breast cells are growing at an unusually fast rate but look normal under a microscope. Women with this condition have a slightly higher risk of developing breast cancer than women with nonproliferative changes."},B.aL2,t.li)
